import React, { useEffect, useState } from 'react';

const App = () => {
  const [data, setData] = useState('');

  useEffect(() => {
    fetch('http://localhost:3001')
      .then((response) => response.text())
      .then((data) => setData(data));
  }, []);

  return (
    <div>
      <h1>Mensaje del Backend: {data}</h1>
    </div>
  );
};

export default App;
